patch_codes:
if (strlen(optarg) == 0) {
    t2p->pdf_datetime[0] = '\x00';
} else {
    t2p->pdf_datetime[0] = 'D';
    t2p->pdf_datetime[1] = ':';
    strncpy(t2p->pdf_datetime + 2, optarg, sizeof (t2p->pdf_datetime) - 3);
    t2p->pdf_datetime[sizeof (t2p->pdf_datetime) - 1] = '\x00';
}

if (tiff2pdf_match_paper_size(&(t2p->pdf_defaultpagewidth), &(t2p->pdf_defaultpagelength), optarg)) {
    t2p->pdf_overridepagesize = 1;
} else {
    TIFFWarning("tiff2pdf", "Unknown paper size %s, ignoring option", optarg);
}
